import React, { Component } from 'react'
import {
    BrowserRouter as Router,
    Link
} from 'react-router-dom'

class Nav extends Component{
    render(){
        return(
            <Router>
                <div>
                    <ul>
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>
                            <Link to="/productos">productos</Link>
                        </li>
                    </ul>
                </div>
            </Router>
        );
    }

}
export default Nav;
